import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import "primereact/resources/primereact.min.css";
import "primereact/resources/themes/tailwind-light/theme.css";  

export const navItems = [
  {
    title: 'Dashboard',
    submenu: [
      {
        title: 'SOG Dashboard',
        url: '/seaofgreen',
        menuRouteTitle:'/seaofgreen',
        parentTitle:'Dashboard',
      },
      {
        title: 'Incident Dashboard',
        url: '/',
        menuRouteTitle:'/',
        parentTitle:'Dashboard',
      }
    ],
  },
  {
      title: 'Configuration',
      submenuType:'horizontal',
      submenu: [
        {
          title: 'Hawkeye configuration',
          parentTitle:'Configuration',
          submenu: [
            {
              title: 'Data Source',
              url: '/configuration',
              menuRouteTitle:'DataSource',
              tabData:{tab:'DataSource'},
              parentTitle:'Configuration',
            },
            {
              title: 'Application',
              url: '/configuration',
              menuRouteTitle:'Application',
              tabData:{tab:'Application'},
              parentTitle:'Configuration',
            },
            {
              title: 'Metric',
              url: '/configuration',
              tabData:{tab:'Metric'},
              menuRouteTitle:'Metric',
              parentTitle:'Configuration',
            },
            {
              title: 'Query',
              url: '/configuration',
              tabData:{tab:'Query'},
              menuRouteTitle:'Query',
              parentTitle:'Configuration',
            },
            {
              title: 'Threshold',
              url: '/configuration',
              menuRouteTitle:'Threshold',
              tabData:{tab:'Threshold'},
              parentTitle:'Configuration',
            },
            {
              title: 'Notifications',
              url: '/configuration',
              menuRouteTitle:'Notifications',
              tabData:{tab:'Notifications'},
              parentTitle:'Configuration',
            },
            {
              title: 'DC Failover',
              url: '/configuration',
              menuRouteTitle:'DcOverride',
              tabData:{tab:'DcOverride'},
              parentTitle:'Configuration',
            },
          ]
        },
        {
          title: 'SOG configuration',
          parentTitle:'Configuration',
          submenu:[
            {
              title: 'Define Section',
              url: '/sogConfiguration/sections',
              menuRouteTitle:'/sogConfiguration/sections',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Channel',
              url: '/sogConfiguration/channels',
              menuRouteTitle:'/sogConfiguration/channels',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Panel',
              url: '/sogConfiguration/panels',
              menuRouteTitle:'/sogConfiguration/panels',
              parentTitle:'Configuration',
            },
            {
              title: 'Configure Rules and Policies',
              url: '/rulesAndPolicyConfig/rules',
              menuRouteTitle:'/rulesAndPolicyConfig/rules',
              parentTitle:'Configuration',
            }
          ]
        }
      ],
    },
];

const MenuItem = ({ title, url }) => {
  return (
    <li>
      <Link to={url}>{title}</Link>
    </li>
  );
};

const SubMenu = ({ submenu, activeSubmenus, onClick }) => {
  return (
    <ul>
      {submenu.map((item, index) => (
        <li key={index}>
          <span onClick={() => onClick(index)}>{item.title}</span>
          {activeSubmenus[index] && item.submenu && (
            <SubMenu
              submenu={item.submenu}
              activeSubmenus={activeSubmenus}
              onClick={onClick}
            />
          )}
        </li>
      ))}
    </ul>
  );
};

const NavItem = ({ title, submenu, index, activeSubmenus, onClick }) => {
  const [active, setActive] = useState(false);

  const handleItemClick = () => {
    setActive(!active);
    onClick(index); // Propagate click to also handle submenu visibility
  };

  return (
    <li onClick={handleItemClick}>
      <span>{title}</span>
      {active && submenu && (
        <SubMenu submenu={submenu} activeSubmenus={activeSubmenus} onClick={onClick} />
      )}
    </li>
  );
};

const Navigation = ({ navItems }) => {
  const [activeSubmenus, setActiveSubmenus] = useState({});

  const handleSubmenuClick = (index) => {
    setActiveSubmenus((prevActiveSubmenus) => ({
      ...prevActiveSubmenus,
      [index]: !prevActiveSubmenus[index],
    }));
  };

  return (
    <ul>
      {navItems.map((item, index) => (
        <NavItem
          key={index}
          index={index}
          {...item}
          activeSubmenus={activeSubmenus}
          onClick={handleSubmenuClick}
        />
      ))}
    </ul>
  );
};

const App = () => {
  return (
    <Router>
      <Navigation navItems={navItems} />
    </Router>
  );
};

export default App;
